import Header from './components/Header'
import Board from './components/Board';

import './App.css';

function App() {
  return (
    <div className="background-image">
      <div className='header'>
        <Header></Header>
      </div>
      <div>
        <Board></Board>
      </div>
    </div>
  );
}

export default App;
